import React, { useEffect, useState } from 'react'
import {useHistory} from 'react-router-dom'
import Navbar from './Navbar';
import Error from './Error';
const QnA = () => {
    const BaseUrl = `http://127.0.0.1:8000`
    const history = useHistory();
    const [question, setQuestion] = useState([])
    useEffect(() => {
        fetch(`${BaseUrl}${history.location.pathname}`)
        .then((data)=> data.json())
        .then((response)=> setQuestion(response)); 
    }, [setQuestion])


    return (
        <>
        <Navbar/>
        {typeof question[0] === "undefined" ? <>
            <Error/>
        </> : question[1].length !== 0 ? <div>
            <h4>
                {question.map((item, index)=> {
                    return(<>
                        <div id={index}>
                            <h4>{item.question}</h4>

                            <p>{}</p>
                        </div>
                    </>)
                })}
            </h4>
            <hr/>
            {question[1].map((item, index) => {
                return(<>
                <div className='container'>
                    <p>{item.answer}</p>
                </div>
                </>
                )
            })}
        </div> : <><h5>You haven't answered it yet</h5></>}
        </>
    )
}

export default QnA
